import React from 'react'
import { Link } from 'react-router-dom';
import '../App.css'

const Header = () => {
  return (
    <div className='container'>
      <div className='row mt-3'>
      <Button
        variant="contained"
        color="secondary"
        className={classes.button}
        startIcon={<DeleteIcon />}
      >
        Delete
      </Button>
      </div>
    </div>
  )
}

export default Header
